        }
        if ($this->isColumnModified(BancoPeer::CUENTA)) {
            $modifiedColumns[':p' . $index++]  = '`CUENTA`';
        }
        if ($this->isColumnModified(BancoPeer::TIPO_BANCO)) {
            $modifiedColumns[':p' . $index++]  = '`TIPO_BANCO`';
        }
        if ($this->isColumnModified(BancoPeer::OBSERVACIONES)) {
            $modifiedColumns[':p' . $index++]  = '`OBSERVACIONES`';
        }
        if ($this->isColumnModified(BancoPeer::ACTIVO)) {
            $modifiedColumns[':p' . $index++]  = '`ACTIVO`';
        }
        if ($this->isColumnModified(BancoPeer::CUENTA_CONTABLE)) {
            $modifiedColumns[':p' . $index++]  = '`CUENTA_CONTABLE`';
        }
        if ($this->isColumnModified(BancoPeer::NOMBRE_BANCO_ID)) {
            $modifiedColumns[':p' . $index++]  = '`NOMBRE_BANCO_ID`';
        }
        if ($this->isColumnModified(BancoPeer::PAGO_CHEQUE)) {
            $modifiedColumns[':p' . $index++]  = '`PAGO_CHEQUE`';
        }
        if ($this->isColumnModified(BancoPeer::DOLARES)) {
            $modifiedColumns[':p' . $index++]  = '`DOLARES`';
        }

        $sql = sprintf(
            'INSERT INTO `banco` (%s) VALUES (%s)',
            implode(', ', $modifiedColumns),
            implode(', ', array_keys($modifiedColumns))
        );

        try {
            $stmt = $con->prepare($sql);
            foreach ($modifiedColumns as $identifier => $columnName) {
                switch ($columnName) {
                    case '`ID`':
                        $stmt->bindValue($identifier, $this->id, PDO::PARAM_INT);
                        break;
                    case '`EMPRESA_ID`':
                        $stmt->bindValue($identifier, $this->empresa_id, PDO::PARAM_INT);
                        break;
                    case '`CODIGO`':
                        $stmt->bindValue($identifier, $this->codigo, PDO::PARAM_STR);
                        break;
                    case '`NOMBRE`':
                        $stmt->bindValue($identifier, $this->nombre, PDO::PARAM_STR);
                        break;
                    case '`CUENTA`':
                        $stmt->bindValue($identifier, $this->cuenta, PDO::PARAM_STR);
                        break;
                    case '`TIPO_BANCO`':
                        $stmt->bindValue($identifier, $this->tipo_banco, PDO::PARAM_STR);
                        break;
                    case '`OBSERVACIONES`':
                        $stmt->bindValue($identifier, $this->observaciones, PDO::PARAM_STR);
                        break;
                    case '`ACTIVO`':
                        $stmt->bindValue($identifier, (int) $this->activo, PDO::PARAM_INT);
                        break;
                    case '`CUENTA_CONTABLE`':
                        $stmt->bindValue($identifier, $this->cuenta_contable, PDO::PARAM_STR);
                        break;
                    case '`NOMBRE_BANCO_ID`':
